int
init_kou(int lgno) {

    register int  i;
    unsigned long cid;

    if (kou_MAX_TRIGs) {
        languages[lgno].dict = make_dict(2 * kou_MAX_TRIGs, 0);
        languages[lgno].hash = (double *)malloc(sizeof(double) * kou_MAX_TRIGs);
        if (!languages[lgno].hash) return(1);
        for (i = 0; i < kou_MAX_TRIGs; i++) {
           cid = string2id((char *)kou_hash[i].trig, languages[lgno].dict, insert_copy);
           if (cid == ~0) return(1);
           languages[lgno].hash[cid] = kou_hash[i].prob;
        }
        languages[lgno].wdict = make_dict(2 * 100, 0);
        languages[lgno].whash = (double *)malloc(sizeof(double) * 100);
        for ( i = 0; i < 99; i++) {
           cid = string2id((char *)kou_wordhash[i].word, languages[lgno].wdict, insert_copy);
           if (cid == ~0) return(1);
           languages[lgno].whash[cid] = kou_wordhash[i].prob;
        }
    } else languages[lgno].used = 0;

    return(0);
}
